import React from 'react';
import styled from 'styled-components';

function ResumeListHeader() {
	return (
		<ComponentWrapper>
			<div class="ResumeList_ResumeList_header__YriXn">
				<h4>최근 문서</h4>
				<a
					href="/cv/intro"
					class="ResumeList_ResumeList_header_link__UNgxP"
					aria-label=""
				>
					<span>원티드 이력서 소개</span>
					<i class="icon-info_icon"></i>
				</a>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	display: flex;
	flex-direction: row;
	justify-content: space-between;
	align-items: flex-end;
	margin-top: 25px;
	margin-bottom: 5px;
`;

export default ResumeListHeader;
